Sibel Kekilli (born 16 June 1980) is a German actress of Turkish descent. She has won two Lolas, the top German acting award. Sibel Kekilli is best known to English speaking audiences playing the role of Shae in Game of Thrones. Her Film and Television career began in 2004, after Kekilli was discovered by a casting agent. She has won many awards, including Best Actress in Gegen de Wand (aka Head On) and Die Fremde (aka When We Leave).

Following the success of her film debut, Kekilli's pornographic career was uncovered by the German media. From 2001 to 2002 she is credited (by IMDb) in 15 hardcore movies. All of which are in this collection.


